/* 显示执行用户类型的列表信息 */
import React from "react";
import PropTypes from "prop-types";
import { WingBlank, WhiteSpace, Card, Header, Body } from "antd-mobile";

class UserList extends React.Component {
  static propTypes = {
    userList: PropTypes.array.isRequired,
  };
  render() {
    return (
      <div>
        <WingBlank>
          <div>
            <WhiteSpace />
            <Card>
              <header
                thumb={require(`../../assets/images/头像1.png`)}
                extra="aa"
              />
              <Body>
                <div>职位：前端工程师</div>
                <div>公司：IBM</div>
                <div>月薪：18K</div>
                <div>描述：React/Vue</div>
              </Body>
            </Card>
          </div>
        </WingBlank>
      </div>
    );
  }
}

export default UserList;
